import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Header = styled.div`
  display: flex;
`;

function Navigation() {
  return (
    <Header>
      <div>Noah Jung</div>
      <Link to="/">About</Link>
      <Link to="/">Work</Link>
    </Header>
  );
}

export default Navigation;
